script: |
  super -f text -I q5624.spq | sort > q5624.out

inputs:
  - name: q5624.spq
    data: |
      SELECT + col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - 37 / + ( + + col1 ) NOT IN ( - + col0, + col1 * - col0, - - col0 * col1 * col2 * + col0 );
  - name: tab2

outputs:
  - name: q5624.out
    data: |
      46
      64
      75
